import React from "react";
import "./index.css";

class Ejercicio extends React.Component {
  constructor(props) {
    super(props);
    this.props = {
      ej: "Ejercicio",
      repes: "Repeticiones",
      series: "Series",
      peso: "Peso"
    };
  }
  render() {
    return (
      <div>
        <label>
          {this.props.ej}
          <input type="text" />
        </label>
        <input type="text" />
        <input type="text" />
        <input type="text" />
      </div>
    );
  }
}

class Mas extends React.Component {
  handleClick() {
    return <Ejercicio ej="pecho" repes="3" series="4" peso="5" />;
  }

  render() {
    return (
      <button
        className="btn btn-primary m-2"
        aria-label="Left Align"
        onClick={() => this.handleClick()}
      >
        +
      </button>
    );
  }
}

export default Mas;
